MATCH (:Payer {id: '8fa6c185-e44e-3e34-8bd8-39be8694f4ce'})-[:HAS_COVERED]->(p:Procedure)
WHERE p.basecost IS NULL
RETURN COUNT(p);

MATCH (p:Payer {id: 'b046940f-1664-3047-bca7-dfa76be352a4'})-[:HAS_COVERED]->(:Medication)-[:IS_COVERED_BY]->(m:Medication)
WHERE NOT EXISTS((m)-[:IS_COVERED_BY]->(p))
RETURN COUNT(m);

MATCH (p:Payer {name: 'Cigna Health'})-[:HAS_PAYERTRANSITION]->(pt:PayerTransition)-[:HAS_PAYERRECORD]->(pyr:Payer)
WHERE pyr.name = 'Cigna Health'
RETURN pyr.qols_avg;

MATCH (m:Medication)-[:IS_COVERED_BY]->(py:Payer {name: 'Dual Eligible'})
WHERE NOT EXISTS(m.payerCoverage)
RETURN COUNT(m);

MATCH (p:Payer {id: '0133f751-9229-3cfd-815f-b6d4979bdd6a'})-[:HAS_COVERED]->(:Medication)-[:IS_COVERED_BY]->(m:Medication)
WHERE NOT EXISTS((p)-[:HAS_COVERED]->(:Medication {code: m.code}))
RETURN COUNT(m);

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy {description: 'Allergy to substance (finding)'})-[:IS_ABOUT]->(p) 
MATCH (p)-[:HAS_HISTORY_OF]->(:Procedure)-[:IS_ORDERED_FOR]->(p) 
RETURN DISTINCT p.firstName, p.lastName, p.id;

MATCH (c:Condition)-[:IS_ABOUT]->(p:Patient)-[:HAS_ADDRESS]->(a:Address)
WHERE a.state IN ['CA', 'FL', 'TX', 'AZ']
RETURN c.description;

MATCH (:Payer {id: 'd18ef2e6-ef40-324c-be54-34a5ee865625'})-[:HAS_COVERED]->(p:Procedure)
WHERE p.basecost IS NULL
RETURN COUNT(p);

MATCH (p:Payer {name: 'NO_INSURANCE'})-[:HAS_COVERED]->(pr:Procedure)
WHERE NOT EXISTS((pr)-[:IS_COVERED_BY]->(p))
RETURN COUNT(pr);
